import React from 'react'
import styles from './skillstyles.module.css'
export default function Skills(props) {
  return (
    <main className={styles.main} >
        <div className={styles.image-wrap}></div>
        <img src={props.imgscr} alt={props.imgName} />
        <h1>React js</h1>

    </main>
  )
}
